import React from 'react'
import './toogleButton.css'

function ToggleButton() {
    return (
        <button className='toggle_Button'>
            <div className='line_button'/>
            <div className='line_button'/>
            <div className='line_button'/>
        </button>
    )
}

export default ToggleButton
